window.bookSummaryJSON = "<p><i>New York Times</i> best-selling author Lynsay Sands, one of paranormal romance's original superstars, delivers a scorching and delightful story of a mortal man on a mission - and the Vamp who is his only hope. </p> <p>One late night leads to... </p> <p>Kidnapped! When Jeanne Louise Argeneau left work, she never thought she'd end up tied down by a good-looking mortal. More attracted than annoyed, she quickly realizes there is more to her abductor than meets the eye. </p> <p>One desperate act leads to... </p> <p>Love? Paul Jones has need of a vampire, and only Jeanne Louise will do. He just has to convince this beauty of a Vamp to help him, never imagining that he would fall in love. But with the immortal world's answer to law enforcement hunting them, their time together is running out... and Paul and Jeanne Louise will need to risk everything to spend an eternity together.</p>"; 
